  PRIMARY KEY (`id`),
  UNIQUE KEY `dataid` (`data_id`) USING BTREE COMMENT '业务数据Id索引'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='流程业务扩展表';

